import React from 'react';

// import '../css/List.css'

class List extends React.Component{

    render() {
        const listItems = this.props.todoList.map((todo, index) => {
            return (
                <li key={index}>{todo}</li>
            );
        });

        return (
            <ul>
                {listItems}
            </ul>
        );
    }
}

export default List;
